#include <iostream>
#include <vector>

using namespace std;

class Solution {
public:
    int minSteps(string s, string t) {
        int cnt[26] = {};
        for (char c: s) {
            cnt[c-'a']++;
        }
        for (char c: t) {
            cnt[c-'a']--;
        }
        int steps = 0;
        for (int i = 0; i < 26; ++i) {
            if (cnt[i] > 0) steps += cnt[i];
        }
        return steps;
    }
};

int main(int argc, char const *argv[])
{
    Solution s;
    string s1="";
    string s2 = "";

    cout<<s.minSteps(s1, s2)<<endl;
    while (cin>>s1>>s2) {
        cout<<s.minSteps(s1, s2)<<endl;
    }
    return 0;
}
